import React from "react";
import { Route, Routes } from "react-router";
import "./App.css";
import Home from "./Components/Home/Home";


function App() {
  return (
    <div className="App">
      <Home />
      <React.Fragment>
        <Routes>
         <Route path="/mainhome" element={<Home />} />
        </Routes>
      </React.Fragment>

    </div>
  );
}

export default App;
